import React from "react";
function Tourism() {
    const [data, setData] = useState([]);
    useEffect(() => {
        fetch("https://mkxbdw.deta.dev")
            .then((response) => response.json())
            .then((data) => {
                setData(data);
                console.log("done");
            });
    }, []);
}

export default Tourism;
